export default function Home({ onSelectApp }) {
  return (
    <div style={{ textAlign: "center", marginTop: "40px" }}>
      <h1>Apps de los compañeros</h1>

      <div
        style={{
          display: "flex",
          flexDirection: "column",
          gap: "15px",
          marginTop: "30px",
          alignItems: "center",
        }}
      >
        <button onClick={() => onSelectApp("clima")}>
          App Clima (Jesús)
        </button>
        <button onClick={() => onSelectApp("app2")}>App 2</button>
        <button onClick={() => onSelectApp("app3")}>App 3</button>
        <button onClick={() => onSelectApp("app4")}>App 4</button>
      </div>
    </div>
  );
}
